import Styles from "./InfoBar.module.css";
export default function InfoBar() {
	return (
		<div
			style={{
				width: "100%",
				height: "100%",
				backgroundColor: "#158CBA",
				color: "white",
			}}
		>
			<h3 style={{ fontWeight: "bold" }}>Enzost4</h3>
			<p style={{ fontWeight: "bold" }}>Quotes 17</p>
		</div>
	);
}
